  return (


    <div className="App">

    <BPP/>

    </div>




  );
}

class BPP extends React.Component{

    render(){
        return (
            <div className='sport_event'>
                <div>
                    <table>
                        <tbody>
                        <tr>
                            <th width="100">

                            </th>
                        </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }


    componentDidMount(){
        let sportEvent=document.querySelectorAll(".sport_event");
        let value=JSON.parse(JSON.stringify(test));
        for(let index in value){
            sportEvent.item(index).innerHTML+=val.awayName;
        }

    }


}



export default App;
